import React from 'react'
import exec from '../exec.json'
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";

class ExecBoard extends React.Component {

    render() {
        return(
            <div>
                {exec.map( execMember => {
                    <p>{execMember.name}</p>
                })}
            </div>
        )
    }
}
export default ExecBoard;
